const TextInput = (props) => {
    const { type, text, placeholder } = props;
    return (
        <div>
            <div>
                <label htmlFor={ type }>{ text }</label>
                <input type='text' placeholder={ placeholder } required id={ type } />
            </div>
        </div>
    );
}

export default TextInput;
